tables.table_schema:
CREATE TABLE diversity_report (
    report_id INT PRIMARY KEY,
    report_title VARCHAR(255),
    report_date DATE,
    impact_rating INT
);

CREATE TABLE diversity_initiatives (
  id INT PRIMARY KEY,
  initiative_name VARCHAR(255),
  start_date DATE,
  end_date DATE
);

CREATE TABLE cultural_impact_reports (
  id INT PRIMARY KEY,
  report_name VARCHAR(255),
  report_date DATE,
  insights TEXT
);

CREATE TABLE DiversityInitiatives (
	employee_id INT,
	employee_name VARCHAR(255),
	initiative_type VARCHAR(100),
	impact_score INT
);

CREATE TABLE OrganizationalCulture (
	employee_id INT,
	culture_type VARCHAR(100),
	satisfaction_score INT,
	engagement_level INT
);

CREATE TABLE DiversityMetrics (
	metric_id INT,
	metric_name VARCHAR(100),
	metric_value DECIMAL(10,2),
	metric_date DATE
);

CREATE TABLE EmployeeFeedback (
	employee_id INT,
	feedback_text TEXT,
	feedback_date TIMESTAMP,
	feedback_category VARCHAR(50)
);

CREATE TABLE DiversityReports (
	report_id INT,
	report_title VARCHAR(255),
	publish_date DATE,
	report_content TEXT
);
